import React, { Component } from 'react';
//import logo from './logo.svg';
import './CardBodyImage.css';

class CardBodyImage extends Component {
  render() {
    return (
      <div className="CardBodyImage">
         This is the CardBodyImage
      </div>
    );
  }
}

export default CardBodyImage;
